import React, { Component } from "react";
import CV from "./Components/CV/CV";

class App extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="App">
        <label htmlFor="name">Name</label>
        <input name="name" />
        <label htmlFor="surname">Surname</label>
        <input name="surname" />
        <CV />
      </div>
    );
  }
}

export default App;
